class PriorityQueue:
    def __init__(self):
        self.heap = []

    def parent(self, i):
        return (i - 1) // 2

    def left(self, i):
        return 2 * i + 1

    def right(self, i):
        return 2 * i + 2

    def swap(self, i, j):
        self.heap[i], self.heap[j] = self.heap[j], self.heap[i]

    def heapify_up(self, i):
        while i > 0 and self.heap[self.parent(i)][0] > self.heap[i][0]:
            self.swap(i, self.parent(i))
            i = self.parent(i)

    def heapify_down(self, i):
        l = self.left(i)
        r = self.right(i)
        smallest = i

        if l < len(self.heap) and self.heap[l][0] < self.heap[i][0]:
            smallest = l
        if r < len(self.heap) and self.heap[r][0] < self.heap[smallest][0]:
            smallest = r

        if smallest != i:
            self.swap(i, smallest)
            self.heapify_down(smallest)

    def extract_min(self):
        if len(self.heap) == 0:
            return None
        if len(self.heap) == 1:
            return self.heap.pop()

        root = self.heap[0]
        self.heap[0] = self.heap.pop()
        self.heapify_down(0)
        return root

    def decrease_key(self, i, new_priority):
        if i >= len(self.heap) or i < 0:
            return

        old_priority = self.heap[i][0]
        self.heap[i] = (new_priority, self.heap[i][1])

        if new_priority < old_priority:
            self.heapify_up(i)

    def insert(self, priority, value):
        self.heap.append((float('inf'), value))
        self.decrease_key(len(self.heap) - 1, priority)

    def __str__(self):
        return str(self.heap)


# Example usage:
pq = PriorityQueue()
pq.insert(5, 'A')
pq.insert(3, 'B')
pq.insert(8, 'C')
print(pq)  # Output: [(3, 'B'), (5, 'A'), (8, 'C')]

pq.decrease_key(2, 2)
print(pq)  # Output: [(2, 'C'), (3, 'B'), (5, 'A')]

print(pq.extract_min())  # Output: (2, 'C')
print(pq)  # Output: [(3, 'B'), (5, 'A')]

"""#Priority Queue - Binary Heap"""

class BinaryHeapPriorityQueue:
    def __init__(self):
        self.heap = []

    def parent(self, i):
        return (i - 1) // 2

    def left(self, i):
        return 2 * i + 1

    def right(self, i):
        return 2 * i + 2

    def swap(self, i, j):
        self.heap[i], self.heap[j] = self.heap[j], self.heap[i]

    def heapify_up(self, i):
        while i > 0 and self.heap[self.parent(i)][0] > self.heap[i][0]:
            self.swap(i, self.parent(i))
            i = self.parent(i)

    def heapify_down(self, i):
        n = len(self.heap)
        l = self.left(i)
        r = self.right(i)
        smallest = i

        if l < n and self.heap[l][0] < self.heap[i][0]:
            smallest = l
        if r < n and self.heap[r][0] < self.heap[smallest][0]:
            smallest = r

        if smallest != i:
            self.swap(i, smallest)
            self.heapify_down(smallest)

    def extract_min(self):
        if len(self.heap) == 0:
            return None
        if len(self.heap) == 1:
            return self.heap.pop()

        root = self.heap[0]
        self.heap[0] = self.heap.pop()
        self.heapify_down(0)
        return root

    def decrease_key(self, i, new_priority):
        if i >= len(self.heap) or i < 0:
            return

        old_priority = self.heap[i][0]
        self.heap[i] = (new_priority, self.heap[i][1])

        if new_priority < old_priority:
            self.heapify_up(i)

    def insert(self, priority, value):
        self.heap.append((float('inf'), value))
        self.decrease_key(len(self.heap) - 1, priority)

    def __str__(self):
        return str(self.heap)


# Example usage:
pq = BinaryHeapPriorityQueue()
pq.insert(5, 'A')
pq.insert(3, 'B')
pq.insert(8, 'C')
print(pq)  # Output: [(3, 'B'), (5, 'A'), (8, 'C')]

pq.decrease_key(2, 2)
print(pq)  # Output: [(2, 'C'), (3, 'B'), (5, 'A')]

print(pq.extract_min())  # Output: (2, 'C')
print(pq)  # Output: [(3, 'B'), (5, 'A')]

"""#Priority Queue - Fibonacci Heap

Fibonacci Heaps:
(Source: https://github.com/danielborowski/fibonacci-heap-python/blob/master/fib-heap.py)
"""

import math


class FibonacciHeap:

    # internal node class
    class Node:
        def __init__(self, key, value):
            self.key = key
            self.value = value
            self.parent = self.child = self.left = self.right = None
            self.degree = 0
            self.mark = False

    # function to iterate through a doubly linked list
    def iterate(self, head):
        node = stop = head
        flag = False
        while True:
            if node == stop and flag is True:
                break
            elif node == stop:
                flag = True
            yield node
            node = node.right

    # pointer to the head and minimum node in the root list
    root_list, min_node = None, None

    # maintain total node count in full fibonacci heap
    total_nodes = 0

    # return min node in O(1) time
    def find_min(self):
        return self.min_node

    # extract (delete) the min node from the heap in O(log n) time
    # amortized cost analysis can be found here (http://bit.ly/1ow1Clm)
    def extract_min(self):
        z = self.min_node
        if z is not None:
            if z.child is not None:
                # attach child nodes to root list
                children = [x for x in self.iterate(z.child)]
                for i in range(0, len(children)):
                    self.merge_with_root_list(children[i])
                    children[i].parent = None
            self.remove_from_root_list(z)
            # set new min node in heap
            if z == z.right:
                self.min_node = self.root_list = None
            else:
                self.min_node = z.right
                self.consolidate()
            self.total_nodes -= 1
        return z

    # insert new node into the unordered root list in O(1) time
    # returns the node so that it can be used for decrease_key later
    def insert(self, key, value=None):
        n = self.Node(key, value)
        n.left = n.right = n
        self.merge_with_root_list(n)
        if self.min_node is None or n.key < self.min_node.key:
            self.min_node = n
        self.total_nodes += 1
        return n

    # modify the key of some node in the heap in O(1) time
    def decrease_key(self, x, k):
        if k > x.key:
            return None
        x.key = k
        y = x.parent
        if y is not None and x.key < y.key:
            self.cut(x, y)
            self.cascading_cut(y)
        if x.key < self.min_node.key:
            self.min_node = x

    # merge two fibonacci heaps in O(1) time by concatenating the root lists
    # the root of the new root list becomes equal to the first list and the second
    # list is simply appended to the end (then the proper min node is determined)
    def merge(self, h2):
        H = FibonacciHeap()
        H.root_list, H.min_node = self.root_list, self.min_node
        # fix pointers when merging the two heaps
        last = h2.root_list.left
        h2.root_list.left = H.root_list.left
        H.root_list.left.right = h2.root_list
        H.root_list.left = last
        H.root_list.left.right = H.root_list
        # update min node if needed
        if h2.min_node.key < H.min_node.key:
            H.min_node = h2.min_node
        # update total nodes
        H.total_nodes = self.total_nodes + h2.total_nodes
        return H

    # if a child node becomes smaller than its parent node we
    # cut this child node off and bring it up to the root list
    def cut(self, x, y):
        self.remove_from_child_list(y, x)
        y.degree -= 1
        self.merge_with_root_list(x)
        x.parent = None
        x.mark = False

    # cascading cut of parent node to obtain good time bounds
    def cascading_cut(self, y):
        z = y.parent
        if z is not None:
            if y.mark is False:
                y.mark = True
            else:
                self.cut(y, z)
                self.cascading_cut(z)

    # combine root nodes of equal degree to consolidate the heap
    # by creating a list of unordered binomial trees
    def consolidate(self):
        A = [None] * int(math.log(self.total_nodes) * 2)
        nodes = [w for w in self.iterate(self.root_list)]
        for w in range(0, len(nodes)):
            x = nodes[w]
            d = x.degree
            while A[d] != None:
                y = A[d]
                if x.key > y.key:
                    temp = x
                    x, y = y, temp
                self.heap_link(y, x)
                A[d] = None
                d += 1
            A[d] = x
        # find new min node - no need to reconstruct new root list below
        # because root list was iteratively changing as we were moving
        # nodes around in the above loop
        for i in range(0, len(A)):
            if A[i] is not None:
                if A[i].key < self.min_node.key:
                    self.min_node = A[i]

    # actual linking of one node to another in the root list
    # while also updating the child linked list
    def heap_link(self, y, x):
        self.remove_from_root_list(y)
        y.left = y.right = y
        self.merge_with_child_list(x, y)
        x.degree += 1
        y.parent = x
        y.mark = False

    # merge a node with the doubly linked root list
    def merge_with_root_list(self, node):
        if self.root_list is None:
            self.root_list = node
        else:
            node.right = self.root_list.right
            node.left = self.root_list
            self.root_list.right.left = node
            self.root_list.right = node

    # merge a node with the doubly linked child list of a root node
    def merge_with_child_list(self, parent, node):
        if parent.child is None:
            parent.child = node
        else:
            node.right = parent.child.right
            node.left = parent.child
            parent.child.right.left = node
            parent.child.right = node

    # remove a node from the doubly linked root list
    def remove_from_root_list(self, node):
        if node == self.root_list:
            self.root_list = node.right
        node.left.right = node.right
        node.right.left = node.left

    # remove a node from the doubly linked child list
    def remove_from_child_list(self, parent, node):
        if parent.child == parent.child.right:
            parent.child = None
        elif parent.child == node:
            parent.child = node.right
            node.right.parent = parent
        node.left.right = node.right
        node.right.left = node.left

class FibonacciHeapPriorityQueue:
    def __init__(self):
        self.fib_heap = FibonacciHeap()

    def insert(self, key, value):
        return self.fib_heap.insert(key, value)

    def decrease_key(self, node, new_key):
        self.fib_heap.decrease_key(node, new_key)

    def extract_min(self):
        min_node = self.fib_heap.extract_min()
        return min_node.value if min_node else None

    def find_min(self):
        min_node = self.fib_heap.find_min()
        return min_node.value if min_node else None

# Example usage:
pq = FibonacciHeapPriorityQueue()
node1 = pq.insert(5, 'A')
node2 = pq.insert(3, 'B')
node3 = pq.insert(8, 'C')
print(pq.find_min())  # Output: 'B'

pq.decrease_key(node3, 2)
print(pq.find_min())  # Output: 'C'

print(pq.extract_min())  # Output: 'C'
print(pq.find_min())  # Output: 'B'

"""#Optimal substructure for MST - Kruskal's Algorithm"""

class Graph:
    def __init__(self, vertices):
        self.V = vertices
        self.graph = []

    def add_edge(self, u, v, w):
        self.graph.append([u, v, w])

    def find(self, parent, i):
        if parent[i] == i:
            return i
        return self.find(parent, parent[i])

    def union(self, parent, rank, x, y):
        x_root = self.find(parent, x)
        y_root = self.find(parent, y)

        if rank[x_root] < rank[y_root]:
            parent[x_root] = y_root
        elif rank[x_root] > rank[y_root]:
            parent[y_root] = x_root
        else:
            parent[y_root] = x_root
            rank[x_root] += 1

    def kruskal_mst(self):
        result = []  # This will store the resultant MST
        i = 0  # An index variable, used for sorted edges
        e = 0  # An index variable, used for result[]

        # Step 1: Sort all the edges in non-decreasing order of their weight
        self.graph = sorted(self.graph, key=lambda item: item[2])

        parent = []
        rank = []

        # Create V subsets with single elements
        for node in range(self.V):
            parent.append(node)
            rank.append(0)

        # Number of edges to be taken is equal to V-1
        while e < self.V - 1:
            # Step 2: Pick the smallest edge and increment the index for next iteration
            u, v, w = self.graph[i]
            i += 1
            x = self.find(parent, u)
            y = self.find(parent, v)

            # If including this edge does not cause cycle, include it in result and increment the index
            if x != y:
                e += 1
                result.append([u, v, w])
                self.union(parent, rank, x, y)

        # Print the constructed MST
        print("Edges in the MST:")
        for u, v, weight in result:
            print(f"{u} - {v} : {weight}")


# Example Usage:
g = Graph(4)
g.add_edge(0, 1, 10)
g.add_edge(0, 2, 6)
g.add_edge(0, 3, 5)
g.add_edge(1, 3, 15)
g.add_edge(2, 3, 4)

g.kruskal_mst()

"""#Karger, Klein, and Tarjan's randomized Minimum Spanning Tree (MST) algorithm"""

import random

class UnionFind:
    def __init__(self, n):
        self.parent = list(range(n))
        self.rank = [0] * n

    def find(self, i):
        if self.parent[i] != i:
            self.parent[i] = self.find(self.parent[i])
        return self.parent[i]

    def union(self, i, j):
        root_i = self.find(i)
        root_j = self.find(j)
        if root_i == root_j:
            return False
        if self.rank[root_i] < self.rank[root_j]:
            self.parent[root_i] = root_j
        elif self.rank[root_i] > self.rank[root_j]:
            self.parent[root_j] = root_i
        else:
            self.parent[root_j] = root_i
            self.rank[root_i] += 1
        return True

def karger_mst(graph):
    n = len(graph)
    edges = [(u, v, weight) for u in range(n) for v, weight in graph[u] if u < v]
    random.shuffle(edges)

    uf = UnionFind(n)
    mst_edges = []
    for u, v, weight in edges:
        if uf.union(u, v):
            mst_edges.append((u, v, weight))
            if len(mst_edges) == n - 1:
                break

    return mst_edges

# Example usage:
graph = {
    0: [(1, 4), (2, 5), (3, 6)],
    1: [(2, 2), (3, 3)],
    2: [(3, 1)]
}
mst = karger_mst(graph)
print("Minimum Spanning Tree Edges:")
for edge in mst:
    print(edge)